import React from 'react';

const name1 = 'Saurav';
const name2 = 'Singh';
const image1 = 'https://picsum.photos/200/300';
const image2 = 'https://picsum.photos/200/300';
const image3 = 'https://picsum.photos/200/300';
const image4= 'https://picsum.photos/200/300';
const links = 'https://www.w3schools.com';

const heading = {
color: 'orange',
textAlign: 'center',
textTransform: 'capitalize',
margin: '50px',
border: '4px solid gray'
}

const InlineWork=()=>{
return(
    <>
    <h1 style={heading}>{`My name is ${name1} ${name2}`}</h1>

<img src={image1} alt="random images"/>
<a href={links} target="_blank">
<img src={image2} alt="random images"/>
</a>
<img src={image3} alt="random images"/>
<img src={image4} alt="random images"/>
    </>
)

}

export default InlineWork;
